      _slides = [];
      json["slides"].forEach((v) {
        _slides.add(Slides.fromJson(v));
      });
    }
    if (json["academies"] != null) {
      _academies = [];
      json["academies"].forEach((v) {
        _academies.add(Data.fromJson(v));
      });
    }
    if (json["players"] != null) {
      _players = [];
      json["players"].forEach((v) {
        _players.add(PlayerData.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["path_prefix"] = _pathPrefix;
    if (_settings != null) {
      map["settings"] = _settings.toJson();
    }
    if (_cities != null) {
      map["cities"] = _cities.map((v) => v.toJson()).toList();
    }
    if (_categories != null) {
      map["categories"] = _categories.map((v) => v.toJson()).toList();
    }
