      map["slides"] = _slides.map((v) => v.toJson()).toList();
    }
    if (_academies != null) {
      map["academies"] = _academies.map((v) => v.toJson()).toList();
    }
    if (_players != null) {
      map["players"] = _players.map((v) => v.toJson()).toList();
    }
    return map;
  }

